import React from 'react';
import Card from 'react-bootstrap/Card'

const Answer_Card = props => {
    let answer = props.answer;

    return (
        <Card>
            <Card.Body>{answer}</Card.Body>
        </Card>
    );
}

export default Answer_Card;
